INSERT INTO `texts` (`id`, `title`, `font`, `body`, `update_date`, `class`, `period`, `outdated`, `dictation`, `filename`) VALUES
(15, 'La volpe e il boscaiolo', 'Arial', '                Una volpe, che fuggiva davanti ai cacciatori, giunse alla capanna di un taglialegna.\r\n                - Per pietà, nascondimi - chiese al taglialegna.\r\n                - Entra nella mia capanna - disse l\'uomo. - Appiattati in quel cantuccio.\r\n                Pochi istanti dopo arrivarono i cacciatori. Domandarono al taglialegna:\r\n                - Hai visto passare di qui una volpe?\r\n                - No - disse il boscaiolo - non ho visto passare di qui nessuna volpe.\r\n                E intanto con la mano faceva segno che si, la volpe l\'aveva vista e che anzi era lì, in quel cantuccio della capanna.\r\n                Ma i cacciatori badarono solo alle parole e non ai gesti, e si allontanarono a grandi passi.\r\n                La volpe li lasciò andare, poi uscì anch\'essa e si avviò, dalla parte opposta. L\'uomo fece l\'offeso:\r\n                - Come? Ti ho salvato e tu ne vai senza nemmeno ringraziare?\r\n                - Ti ringrazierei - rispose la volpe - e di cuore, se i tuoi gesti andassero d\'accordo con le tue parole.\r\n                E tirò via.\r\n', '2022-08-25 16:37:02', '2a', 'Inizio', 0, 0, NULL),
(16, 'Alì salva la luna', 'Arial', '                Una volta verso sera, Alì andò a prendere acqua. Curvandosi sul pozzo, vide laggiù in fondo, nell\'acqua, la luna che si specchiava.\r\n                - Poveri noi - gridò Alì - la luna è caduta nel pozzo. Presto, presto, tiriamola fuori.\r\n                E corse a prendere corda e uncino.\r\n                Il bravo Alì si diede da fare per un bel pezzo, ma l\'uncino non riusciva ad acchiappare la luna per tirarla su. Alla fine Alì ebbe l\'impressione che l\'uncino avesse fatto presa e cominciò a tirare.\r\n                - Acciderba, se pesa ... - sospirava. E tirava con tutte le sue forze, puntando i piedi contro il parapetto del pozzo. A un tratto l\'uncino si staccò. Alì cadde sulla schiena, guardò in alto e vide la luna in mezzo al cielo.\r\n                - Dio sia lodato - esclamò Alì soddisfatto - mi sarò fatto qualche bernoccolo ma la luna è tornata al suo posto.\r\n', '2022-08-26 20:57:06', '2a', 'Inizio', 0, 0, NULL),
(17, 'La storia di babbo natale', 'Arial', '                Babbo Natale con la slitta si avvicina alla città.\r\n                È notte fonda.\r\n                Nessuno lo vede. Tutti i bambini sono sotto le coperte a sognare.\r\n                Babbo Natale si ferma davanti alle case e prende il grande foglio dove sono scritti i nomi di tutti i bambini.\r\n                Poi entra nelle case e qui lascia il trenino, lì il carro dei pompieri, la cucinina, i burattini, e così via.\r\n', '2022-08-26 20:58:27', '1a', 'Inizio', 0, 0, NULL),
(18, 'Il bruco e i gerani', 'Arial', '                La mamma di Gigi ha messo in casa i gerani, al riparo dal freddo. Un giorno trova un piccolo bruco verde, che mangia le foglie.\r\n                - Povere foglie! - dice la mamma.\r\n                - Povero bruco! - dice Gigi. - Che fine farà? Bisogna salvarlo.\r\n                Prepara un aeroplanino di carta e vi spinge sopra il bruco. \r\n                La mamma apre la finestra e Gigi fa volare l\'aereo. \r\n                - Speriamo che scenda nell\'erba del prato! - esclama. - Anche quella è buona da mangiare.\r\n', '2022-08-26 20:59:13', '1a', 'Fine', 0, 0, NULL),
(19, 'L\'uomo che non riusciva a crescere', 'Arial', '                Una volta, presso una palude, viveva un uomo alto appena appena due spanne, e aspettava sempre di crescere, ma non cresceva mai.\r\n                Quando fu stanco di aspettare, decise di domandare consiglio alle creature più grandi di lui e andò dal saggio barbagianni.\r\n                - Tu che sei tanto saggio, mi sai dire che devo fare per diventare più alto?\r\n                - Aspetta, perché hai bisogno di diventare più alto?\r\n                - Per vedere più da lontano.\r\n                - Se vuoi vedere più da lontano, arrampicati su un albero. O forse non sei capace?\r\n                - Si, che sono capace. Però non mi era mai venuto in mente.\r\n                Il barbagianni socchiuse gli occhi e disse:\r\n                - Vedi. L\'uomo non ha bisogno di avere un gran corpo, ma un buon cervello. Chi ha intelletto è sempre grande e grosso abbastanza.\r\n', '2022-08-26 21:00:08', '2a', 'Inizio', 0, 0, NULL),
(20, 'Il re Alfredo', 'Arial', '                mille e più anni or sono, in Inghilterra regnava un bravo re di nome Alfredo. \r\n                Egli fu il primo a costruire una grande flotta di navi a difesa dell\'Inghilterra, che, essendo un\'isola, è circondata da ogni parte dal mare.\r\n                Percorreva il paese senza scorta e senza seguito. E spesso si intratteneva coi suoi sudditi, senza farsi riconoscere.\r\n                Un giorno arrivò alla casa d\'una povera donna e chiese il permesso di riposarsi. La donna lo fece sedere in cucina, in attesa che alcune focacce che erano nel forno fossero cotte. A un certo momento, la donna ebbe bisogno di andare al pozzo per attingere acqua.\r\n                Non vorrei però che le focacce si bruciassero - disse la donna, che non sapeva con chi aveva a che fare. L\'uomo promise di sorvegliarle.\r\n                Ma appena la donna se ne fu andata, il re Alfredo, che aveva tanti pensieri, dimenticò la promessa e le focacce diventarono carbone.\r\n                Torna la donna e, sentendo puzzo di bruciato, rimprovera il re come se fosse stato un ragazzo scapato.\r\n                - Poco giudizio: - gli dice. - Non siete capace neppure di sorvegliare due focacce.\r\n                Il re Alfredo, punto dell\'amor proprio, tentò di scusarsi: - Io sono il re d\'Inghilterra, e quindi ho ben altri pensieri. La donna lo guardò con meraviglia. Poi senza scomporsi gli disse:\r\n                - Sta bene, voi sarete un re, ma in questo momento il vostro dovere era di sorvegliare che le focacce non si bruciassero.\r\n                - Avete ragione: - esclamò il re Alfredo. - E vi ringrazio della lezione. Ogni dovere va assolto bene, anche se piccolo. Da tutti, anche dai re\r\n', '2022-08-26 21:01:03', '3a', 'Fine', 0, 0, NULL),
(21, 'La gatta zoppa', 'Arial', '                In un mattino d\'inverno mentre cadevano fiocchi di neve nel giardino nella mia casa di campagna apparve una gatta bianca e nera che zoppicava e chiedeva aiuto con gli occhi. \r\n                Venne fin sull\'uscio di casa e con la testa mi accarezzava le gambe e voleva a tutti i costi che mi accorgessi che aveva una zampa malata.\r\n                Ebbi compassione di quella povera gatta e le diedi un po\' di latte caldo ed un pezzetto di carne di pollo.\r\n                Dopo aver aver mangiato scomparve ed io rimasi a guardare la neve che imbiancava il prato.\r\n                Non passarono neanche tre minuti che la gatta zoppicando ricomparve da dietro l\'angolo della casa con gli occhi mesti e l\'andatura lenta.\r\n                Si avvicinò di nuovo per farsi accarezzare e poi tornò indietro come per cercare qualcosa.\r\n                Ricomparve con tre piccoli gattini infreddoliti uno dietro l\'altro e li portò vicino a me per farmeli vedere.\r\n                Avevano freddo e fame e diedi a loro il latte e la carne mentre la mamma, felice, li leccava per pulirli.\r\n                Misi tutta la famigliola in una cassetta con la lana e la portai al riparo nel ripostiglio con la legna.\r\n                La gatta, una volta al sicuro, non zoppicò più e continuò ad accarezzarmi le gambe con la sua testa.\r\n                Recitò tutta quella parte per commuovermi e per salvare i suoi gattini dal freddo.\r\n', '2022-08-26 21:02:21', '3a', 'Fine', 0, 0, NULL),
(22, 'Il nanetto che voleva la pera', 'Arial', '                Sotto un piccolo abete rosso in un bosco viveva un nanetto non più grande di una pigna.\r\n                Quando venne l\'autunno il nostro omino si disse: - È tempo che vada a far provvista di pere per quando verrà l\'inverno.\r\n                Così il mattino dopo, il nanetto indossò la sua giacchettina, si mise in testa il berretto rosso, prese il sacco da montagna e si incamminò verso il villaggio.              \r\n                Il nanetto attraversò felicemente il bosco e il prato e arrivò al frutteto.\r\n                Là le pere gialle gli sorridevano invitanti dall\'albero. Ma ahimè, le pere erano in alto, e il nanetto in basso.\r\n                Il vento che danzava gaiamente sulla cima dell\'albero vide la difficoltà dell\'omino e gli gettò davanti ai piedi una delle pere più belle.\r\n                Il nanetto non stava più in sé dalla gioia, fece al vento un profondissimo inchino e disse:\r\n                - Grazie mille!\r\n                Poi ficcò la pera nel suo sacco da montagna, se lo mise sulle spalle e tornò a casa.\r\n                E che cosa pensate che ne abbia fatto, il nanetto, di quella pera? Ne mangiò una parte cruda, una parte ne fece marmellata, una parte la tagliò ben bene a pezzetti e la mise sotto zucchero per l\'inverno, e dal resto ne ricavò del sidro dolce.\r\n                E ne bevve tanto che il mondo cominciò a girargli intorno, al punto che il nanetto non sapeva più se a danzare erano gli alberi o era lui. Alla fine cadde al suolo stanco morto e si addormentò.\r\n', '2022-08-27 06:53:32', '2a', 'Fine', 0, 0, NULL),
(23, 'Storia di uno sbadiglio', 'Arial', '                Un giorno una ragazzina portò a passeggio la sorellina in carrozzella. La sorellina era stanca, e sbadigliò, Allora anche alla ragazzina venne voglia di sbadigliare.\r\n                La donna del negozio di cappelli la vide e subito sbadigliò anche lei, e la gente alla fermata del tram e il giornalaio e il ciclista, tutti si misero a sbadigliare.\r\n                Arrivò il tram e il manovratore, vedendo tutte quelle bocche aperte, cominciò a sbadigliare e sbadigliare, e non riusciva a ripartire. Un camionista, che voleva sapere perché il tram stesse fermo per tanto tempo, si sporse dal finestrino e subito lo sbadiglio colse anche lui.\r\n                Gli altri automobilisti lo videro. Subito fermarono le automobili e sbadigliarono. Il vigile voleva suonare il fischietto perché tutti si decidessero a rimettersi in moto. Ma non riuscì a fischiare, perché venne voglia di sbadigliare anche a lui.\r\n                In breve tempo tutta la gente, tutti i cani e i gatti della città si misero a sbadigliare, anche lo spazzacamino sul tetto e persino i lombrichi nella terra! Per fortuna fu presto sera, e tutti andarono a dormire di buon\'ora.\r\n', '2022-08-27 06:54:48', '3a', 'Inizio', 0, 0, NULL),
(24, 'La fiaba dello scoiattolo', 'Arial', '                C\'era una volta una bambina che cercava funghi nel bosco. Sotto un albero, vide uno scoiattolo piccolo piccolo con una grande coda soffice.\r\n                Lo scoiattolino non si mosse e non cercò di scappare. Tremava tutto, con gli occhietti chiusi.\r\n                - Povero scoiattolino - disse la bambina - forse è malato.\r\n                Si inginocchiò, si tolse il berretto di lana e lo mise intorno allo scoiattolino.\r\n                Il giorno dopo, lo scoiattolino era ancora là, dentro il berretto. La bambina gli mise vicino delle briciole di pane.\r\n                Il terzo giorno, lo scoiattolino era scomparso. Per terra c\'era il berretto di lana e nel mezzo brillava un anellino d\'oro.\r\n', '2022-08-27 06:55:45', '1a', 'Fine', 0, 0, NULL),
(25, 'Il semaforo che si era stancato', 'Arial', '                Un giorno un semaforo, che si trovava ad un incrocio al centro della città si stancò. Era stufo di accendere sempre gli stessi tre colori: rosso, giallo, verde.      \r\n                - Esistono tanti altri bei colori - pensava - il blu il celeste, il bianco, il rosa, il marrone... perché non dovrei mai usarli?\r\n                Fu così che quel giorno, a quell\'incrocio, se ne videro davvero di tutti i colori.\r\n                Autisti e pedoni non capivano più nulla.\r\n                - Chi deve passare ora che il semaforo è blu? - chiedeva uno.\r\n                E un altro diceva: - Il grigio è per le auto o per i pedoni?\r\n                Finalmente, pedoni e autisti decisero di mettersi d\'accordo: col rosa sarebbero passate le donne, con l\'azzuro gli uomini, col bianco i bambini e col grigio le persone anziane; quanto alle automobili sarebbero passate con il lilla, mentre i camion sarebbero passati col marrone.\r\n                Mai a quell\'incrocio, il traffico era stato tanto rapido ed ordinato, e perfino divertente.\r\n                Si divertiva finalmente anche il semaforo.\r\n                Ma ad un tratto arrivò un vigile urbano che teneva molto al regolamento.\r\n                - Questo semaforo si è guastato - disse. - Corro subito a telefonare per farlo riparare.\r\n                A sentirlo, il nostro semaforo si arrabbiò moltissimo. E, messo il rosso da tutte le parti, non fece passare più nessuno.', '2022-08-27 06:56:40', '1a', 'Inizio', 0, 0, NULL),
(26, 'La fiaba del tappeto', 'Arial', '                C\'era una volta un bambino molto piccolo e curioso. Un giorno, si fermò a guardare una scimmietta. Quando si girò non vide più, in mezzo alla folla, né il papà né la mamma.\r\n                Cammina cammina, non riusciva a trovarli. Allora si mise a piangere.\r\n                - Perché piangi? - gli chiese un vecchio che vendeva tappeti.\r\n                Il bambino gli disse che si era perduto.\r\n                - Vuoi tornare a casa? Siediti su questo tappeto. È un tappeto speciale, che non vendo a nessuno.\r\n                Il bambino si sedette. E il tappeto, che era magico, volò sopra il mercato, sopra la città e i campi, e atterrò proprio davanti alla sua casa.\r\n                Il bambino scese felice. Quando si voltò per ringraziare quel tappeto meraviglioso, lo vide già in alto nel cielo, e sempre più lontano. Il tappeto tornava dal suo padrone.\r\n', '2022-08-27 06:57:27', '2a', 'Inizio', 0, 0, NULL),
(27, 'I topi campanari', 'Arial', '                C\'era una volta un vecchio campanile abbandonato, e nel vecchio campanile c\'erano molti topi.\r\n                Un giorno, dall\'alto, videro il campanaro che tirava una lunga fune e sentirono suonare la campana.\r\n                A certi topi la cosa sembrò molto bella. Quando il campanaro andò via, essi proposero agli altri di provare anche loro a suonare la campana.\r\n                - Si, si, suoniamo la campana! Diventeremo famosi tutti ci ammireranno! - dissero gli altri, e si attaccarono tutti alla fune.\r\n                La fune dondolava in qua e in là, ma la campana non suonava. I topi raddoppiarono i loro sforzi, e non si accorsero che il campanaro era tornato e stava anche lui tirando la fune.\r\n                La campana si mise a suonare.\r\n                Quando il campanaro se ne andò di nuovo e il suono cessò, i topi abbandonarono la corda e si abbracciarono felici tra loro.\r\n                - È stata una grande fatica, - dissero - ma ci siamo riusciti!\r\n                E si sparsero ai quattro venti per raccontare a tutti la loro impresa.\r\n', '2022-08-27 06:58:58', '2a', 'Fine', 0, 0, NULL),
(28, 'La percezione del tempo', 'Arial', 'Il tempo, con le sue peculiari caratteristiche, è stato da sempre oggetto di studio di filosofi e scienziati\r\nche con le loro analisi hanno provato a comprenderne la natura e concettualizzarlo con maggiore chiarezza;\r\ntuttavia sembra che la sua essenza astratta e intagibile non consenta di giungere ad una descrizione univoca.\r\n\tL\'esistenza del tempo con il suo scorrere inesorabile appare palese, pertanto da sempre l\'umanità ha \r\ntentato di misurarlo e nel corso dei secoli si è prodigata, con l\'avanzare delle tecnologie, nella creazione 
INSERT INTO `texts` (`id`, `title`, `font`, `body`, `update_date`, `class`, `period`, `outdated`, `dictation`, `filename`, `type`) VALUES
(15, 'La volpe e il boscaiolo', 'Arial', '                Una volpe, che fuggiva davanti ai cacciatori, giunse alla capanna di un taglialegna.\r\n                - Per pietà, nascondimi - chiese al taglialegna.\r\n                - Entra nella mia capanna - disse l\'uomo. - Appiattati in quel cantuccio.\r\n                Pochi istanti dopo arrivarono i cacciatori. Domandarono al taglialegna:\r\n                - Hai visto passare di qui una volpe?\r\n                - No - disse il boscaiolo - non ho visto passare di qui nessuna volpe.\r\n                E intanto con la mano faceva segno che si, la volpe l\'aveva vista e che anzi era lì, in quel cantuccio della capanna.\r\n                Ma i cacciatori badarono solo alle parole e non ai gesti, e si allontanarono a grandi passi.\r\n                La volpe li lasciò andare, poi uscì anch\'essa e si avviò, dalla parte opposta. L\'uomo fece l\'offeso:\r\n                - Come? Ti ho salvato e tu ne vai senza nemmeno ringraziare?\r\n                - Ti ringrazierei - rispose la volpe - e di cuore, se i tuoi gesti andassero d\'accordo con le tue parole.\r\n                E tirò via.\r\n', '2022-08-25 16:37:02', '2a', 'Inizio', 0, 0, NULL, 'Testo'),
(16, 'Alì salva la luna', 'Arial', '                Una volta verso sera, Alì andò a prendere acqua. Curvandosi sul pozzo, vide laggiù in fondo, nell\'acqua, la luna che si specchiava.\r\n                - Poveri noi - gridò Alì - la luna è caduta nel pozzo. Presto, presto, tiriamola fuori.\r\n                E corse a prendere corda e uncino.\r\n                Il bravo Alì si diede da fare per un bel pezzo, ma l\'uncino non riusciva ad acchiappare la luna per tirarla su. Alla fine Alì ebbe l\'impressione che l\'uncino avesse fatto presa e cominciò a tirare.\r\n                - Acciderba, se pesa ... - sospirava. E tirava con tutte le sue forze, puntando i piedi contro il parapetto del pozzo. A un tratto l\'uncino si staccò. Alì cadde sulla schiena, guardò in alto e vide la luna in mezzo al cielo.\r\n                - Dio sia lodato - esclamò Alì soddisfatto - mi sarò fatto qualche bernoccolo ma la luna è tornata al suo posto.\r\n', '2022-08-26 20:57:06', '2a', 'Inizio', 0, 0, NULL, 'Testo'),
(17, 'La storia di babbo natale', 'Arial', '                Babbo Natale con la slitta si avvicina alla città.\r\n                È notte fonda.\r\n                Nessuno lo vede. Tutti i bambini sono sotto le coperte a sognare.\r\n                Babbo Natale si ferma davanti alle case e prende il grande foglio dove sono scritti i nomi di tutti i bambini.\r\n                Poi entra nelle case e qui lascia il trenino, lì il carro dei pompieri, la cucinina, i burattini, e così via.\r\n', '2022-08-26 20:58:27', '1a', 'Inizio', 0, 0, NULL, 'Testo'),
(18, 'Il bruco e i gerani', 'Arial', '                La mamma di Gigi ha messo in casa i gerani, al riparo dal freddo. Un giorno trova un piccolo bruco verde, che mangia le foglie.\r\n                - Povere foglie! - dice la mamma.\r\n                - Povero bruco! - dice Gigi. - Che fine farà? Bisogna salvarlo.\r\n                Prepara un aeroplanino di carta e vi spinge sopra il bruco. \r\n                La mamma apre la finestra e Gigi fa volare l\'aereo. \r\n                - Speriamo che scenda nell\'erba del prato! - esclama. - Anche quella è buona da mangiare.\r\n', '2022-08-26 20:59:13', '1a', 'Fine', 0, 0, NULL, 'Testo'),
(19, 'L\'uomo che non riusciva a crescere', 'Arial', '                Una volta, presso una palude, viveva un uomo alto appena appena due spanne, e aspettava sempre di crescere, ma non cresceva mai.\r\n                Quando fu stanco di aspettare, decise di domandare consiglio alle creature più grandi di lui e andò dal saggio barbagianni.\r\n                - Tu che sei tanto saggio, mi sai dire che devo fare per diventare più alto?\r\n                - Aspetta, perché hai bisogno di diventare più alto?\r\n                - Per vedere più da lontano.\r\n                - Se vuoi vedere più da lontano, arrampicati su un albero. O forse non sei capace?\r\n                - Si, che sono capace. Però non mi era mai venuto in mente.\r\n                Il barbagianni socchiuse gli occhi e disse:\r\n                - Vedi. L\'uomo non ha bisogno di avere un gran corpo, ma un buon cervello. Chi ha intelletto è sempre grande e grosso abbastanza.\r\n', '2022-08-26 21:00:08', '2a', 'Inizio', 0, 0, NULL, 'Testo'),
